		//used as a cutoff for when a match is detected correctly
		private float varianceOfBinsAllowed = 0.1f;

		private bool wasPaused = false;

		#endregion Private Fields

		#region Public Constructors

		//amount of variance allowed for correct comparison
		public CrashNSaneLoadDetector()
		{
			InitializeComponent();
			captureTimer = new System.Timers.Timer();

			captureTimer.Elapsed += recordOrDetect;

			oldGameTime = DateTime.Now;
			oldRealTime = DateTime.Now;
			captureTimer.Interval = 33;
			gameTimer = new System.Timers.Timer();
			realTimer = new System.Timers.Timer();
			gameTimer.Interval = 33;
			realTimer.Interval = 33;
			gameTimer.Elapsed += countGameTime;
			realTimer.Elapsed += countRealTime;
			listOfFeatureVectors = new List<List<int>>();
			histogramMatches = new List<bool>();
			msElapsed = new List<long>();
			lastFeatures = new List<int>();
		}

		#endregion Public Constructors

		#region Private Methods

		private static Bitmap CaptureImage(int x, int y, int width, int height)
		{
			Bitmap b = new Bitmap(width, height);
			using (Graphics g = Graphics.FromImage(b))
			{
				g.CopyFromScreen(x - width / 2, y - height / 2, 0, 0, new Size(width, height), CopyPixelOperation.SourceCopy);
			}
			return b;
		}

		private void captureAndUpdate(object source, ElapsedEventArgs e)
		{
			List<int> features = featuresAtScreenCenter();
		}

		private bool compareFeatureVector(int[,] comparison_vectors, int[] newVector)
		{
			int size = newVector.Length;

			

			if (comparison_vectors.GetLength(1) < size)
			{
				size = comparison_vectors.GetLength(1);
			}

			//int number_of_bins_needed = 290;// (int) (size * percent_of_bins_correct);
			matchingBins = 0;
			int numVectors = comparison_vectors.GetLength(0);

			for (int bin = 0; bin < size; bin++)
			{
				//Determine upper/lower histogram ranges for matching bins

				for (int vectorIndex = 0; vectorIndex < numVectors; vectorIndex++)
				{
					int lower_bound = (int)(comparison_vectors[vectorIndex, bin] * (1.0f - varianceOfBinsAllowed));
					int upper_bound = (int)(comparison_vectors[vectorIndex, bin] * (1.0f + varianceOfBinsAllowed));

					//check if the current feature vector matches *any other* of the captured ones
					if (newVector[bin] < upper_bound && newVector[bin] > lower_bound)
					{
						matchingBins++;
						break;
					}
				}


				
			}

			System.Console.WriteLine("Matching bins: " + matchingBins);

			if (matchingBins >= numberOfBinsCorrect)
			{
				//if we found enough similarities, we found a match.
				return true;
			}
			return false;
		}

		private void countGameTime(object source, ElapsedEventArgs e)
		{
			if (currentlyPaused == true && wasPaused == false)
			{
				//starting loading
				loadStart = DateTime.Now;
				loadTimeTemp = loadTime;
			}
			else if (currentlyPaused == false && wasPaused == true)
			{
				//loading done
				loadTime = loadTimeTemp + (DateTime.Now - loadStart);
				try
				{
					Invoke(new Action(() =>
					{
						pauseSegmentList.Items.Add(DateTime.Now - loadStart);
					}));
				}
				catch
				{
					//if the form is closing, we just do nothing.
				}
			}
			else if (currentlyPaused == true && wasPaused == true)
			{
				//intermediate loading time values for display
				loadTime = DateTime.Now - loadStart + loadTimeTemp;
			}

			gameTime = realTime - loadTime;
			try
			{
				Invoke(new Action(() =>
				{
					gameTimeLabel.Text = gameTime.ToString();
					pausedTimeLabel.Text = loadTime.ToString();
				}));
			}
			catch
			{
				//if the form is closing, we just do nothing.
			}
			wasPaused = currentlyPaused;
		}

		private void countRealTime(object source, ElapsedEventArgs e)
		{
			realTime = DateTime.Now - timerBegin;
			try
			{
				Invoke(new Action(() =>
				{
					realTimeLabel.Text = realTime.ToString();
				}));
			}
			catch
			{
				//if the form is closing, we just do nothing.
			}
			oldRealTime = DateTime.Now;
		}

		private List<int> featuresAtScreenCenter()
		{
			Stopwatch stopwatch = Stopwatch.StartNew();
			Bitmap bmp = null;

			Rectangle screenRect = Screen.GetBounds(Bounds);

			Point screenCenter = new Point(screenRect.Width / 2, screenRect.Height / 2);

			

			bmp = CaptureImage(screenCenter.X, screenCenter.Y - 40, captureSize.Width, captureSize.Height);

			List<int> features = featuresFromBitmap(bmp);
			lastFeatures = features;
			bool matchingHistograms = compareFeatureVector(listOfFeatureVectorsEng, features.ToArray());
			currentlyPaused = matchingHistograms;
			stopwatch.Stop();

			msElapsed.Add(stopwatch.ElapsedMilliseconds);
			if (msElapsed.Count > 20)
			{
				long sum = 0;

				foreach (var ms in msElapsed)
				{
					sum += ms;
				}
				sum /= msElapsed.Count;
				msElapsed.Clear();
				Console.WriteLine("DetectMatch (avg): " + sum + "ms");
			}

			if (currentlyPaused)
			{
				//only save if we haven't saved for at least 10 frames, just for diagnostics to see if any false positives are in there.
				//or if we haven't seen a paused frame for at least 30 frames.
				if (frameCount > (lastSaveFrame + 10) || (frameCount - lastPausedFrame) > 30)
				{
					System.IO.Directory.CreateDirectory("imgs_stopped");
					bmp.Save("imgs_stopped/img_" + frameCount + "_" + matchingBins + ".jpg", ImageFormat.Jpeg);
					lastSaveFrame = frameCount;
				}

				lastPausedFrame = frameCount;
			}
			else
			{
				//save if we haven't seen a running frame for at least 30 frames (to detect false runs - e.g. aku covering "loading"
				if ((frameCount - lastRunningFrame) > 30)
				{
					System.IO.Directory.CreateDirectory("imgs_running");
					bmp.Save("imgs_running/img_" + frameCount + "_" + matchingBins + ".jpg", ImageFormat.Jpeg);
					lastSaveFrame = frameCount;
				}
				lastRunningFrame = frameCount;
			}

			frameCount++;
			histogramMatches.Add(matchingHistograms);
			try
			{
				Invoke(new Action(() =>
				{
					imageDisplay.Image = bmp;
					imageDisplay.Size = new Size(captureSize.Width, captureSize.Height);
					imageDisplay.BackgroundImage = bmp;
					imageDisplay.Refresh();
					matchDisplayLabel.Text = matchingBins.ToString();
					requiredMatchDisplayLabel.Text = numberOfBinsCorrect.ToString();
					if (matchingHistograms)
					{
						//paused
						pausedDisplay.BackColor = Color.Red;
					}
					else
					{
						//running
						pausedDisplay.BackColor = Color.Green;
					}
				}));
			}
			catch
			{
				//if the form is closing, we just do nothing.
			}
			bmp.Dispose();
			return features;
		}

		private List<int> featuresFromBitmap(Bitmap capture)
		{
			List<int> features = new List<int>();

			
			BitmapData bData = capture.LockBits(new Rectangle(0, 0, capture.Width, capture.Height), ImageLockMode.ReadWrite, capture.PixelFormat);

			int size = bData.Stride * bData.Height;

			byte[] data = new byte[size];

			/*This overload copies data of /size/ into /data/ from location specified (/Scan0/)*/
			System.Runtime.InteropServices.Marshal.Copy(bData.Scan0, data, 0, size);
			int yAdd = 0;
			int r = 0;
			int g = 0;
			int b = 0;
			//we look at 50x50 patches and compute histogram bins for the a/r/g/b values.

			int stride = 1; //spacing between feature pixels

			for (int patchX = 0; patchX < (capture.Width / patchSize); patchX++)
			{
				for (int patchY = 0; patchY < (capture.Height / patchSize); patchY++)
				{
					//int[] patch_hist_a = new int[numberOfBins];
					int[] patchHistR = new int[numberOfBins];
					int[] patchHistG = new int[numberOfBins];
					int[] patchHistB = new int[numberOfBins];

					int xStart = patchX * (patchSize * stride);
					int yStart = patchY * (patchSize * stride);
					int xEnd = (patchX + 1) * (patchSize * stride);
					int yEnd = (patchY + 1) * (patchSize * stride);

					for (int x_index = xStart; x_index < xEnd; x_index += stride)
					{
						for (int y_index = yStart; y_index < yEnd; y_index += stride)
						{
							yAdd = y_index * capture.Width;

							r = (int)(data[x_index + yAdd + 1]);
							g = (int)(data[x_index + yAdd + 2]);
							b = (int)(data[x_index + yAdd + 3]);

							patchHistR[(r * numberOfBins) / 256]++;
							patchHistG[(g * numberOfBins) / 256]++;
							patchHistB[(b * numberOfBins) / 256]++;
						}
					}

					//enter the histograms as our features
					features.AddRange(patchHistR);
					features.AddRange(patchHistG);
					features.AddRange(patchHistB);
				}
			}

			capture.UnlockBits(bData);

			return features;
		}

		private void recordCheck_CheckedChanged(object sender, EventArgs e)
		{
			recordMode = recordCheck.Checked;
		}

		private void recordFeature(object source, ElapsedEventArgs e)
		{
			listOfFeatureVectors.Add(featuresAtScreenCenter());
		}

		private void recordOrDetect(object source, ElapsedEventArgs e)
		{
			if (recordMode)
			{
				recordFeature(source, e);
			}
			else
			{
				captureAndUpdate(source, e);
			}
		}

		private void saveDiagnosticCheck_CheckedChanged(object sender, EventArgs e)
		{
			saveDiagnosticImages = saveDiagnosticCheck.Checked;
		}

		private void startButton_Click(object sender, EventArgs e)
		{
			captureTimer.Enabled = !captureTimer.Enabled;

			if (recordMode)
			{
				if (captureTimer.Enabled == false)
				{
					using (var file = File.CreateText("loading_eng.csv"))
					{
						foreach (var list in listOfFeatureVectors)
						{
							file.WriteLine(string.Join(",", list));
						}
					}

					listOfFeatureVectors.Clear();
				}
			}
			else
			{
				oldGameTime = DateTime.Now;
				oldRealTime = DateTime.Now;
				timerBegin = DateTime.Now;
				loadStart = DateTime.Now;
				realTime = new TimeSpan(0);
				gameTime = new TimeSpan(0);
				loadTime = new TimeSpan(0);
				loadTimeTemp = new TimeSpan(0);

				currentlyPaused = false;
				frameCount = 0;
				lastRunningFrame = 0;
				lastPausedFrame = 0;
				lastSaveFrame = 0;
				msElapsed.Clear();

				gameTimer.Enabled = !gameTimer.Enabled;
				realTimer.Enabled = !realTimer.Enabled;
			}
		}

		#endregion Private Methods

		private int currentRecordCount = 0;

		private void CrashNSaneLoadDetector_FormClosing(object sender, FormClosingEventArgs e)
		{
			gameTimer.Enabled = false;
			realTimer.Enabled = false;
			captureTimer.Enabled = false;
		}

		private void recordCurrentButton_Click(object sender, EventArgs e)
		{
			currentRecordCount++;
			listOfFeatureVectors.Add(lastFeatures);
			using (var file = File.CreateText("loading_eng_features.txt"))
			{
				file.Write("private int[,] listOfFeatureVectorsEng = {\n");
				foreach (var list in listOfFeatureVectors)
				{
					file.Write("{");
					file.Write(string.Join(",", list));
					file.Write("},\n");
				}
				

				file.Write("};\n");
			}
		}
	}
}